import React from "react";
import PropTypes from "prop-types";

const foodILike = [
  {
    id: 1,
    name: "Kimchi",
    image:
      "data:image/jpeg;base64,",
    rating: 5
  },
  {
    id: 2,
    name: "Samgyeopsal",
    image:
      "data:image/jpeg;base64,",
    rating: 4.9
  },
  {
    id: 3,
    name: "Bibimbap",
    image:
      "data:image/jpeg;base64,",
    rating: 4.8
  },
  {
    id: 4,
    name: "Kimbap",
    image:
      "data:image/jpeg;base64,",
    rating: 4.7
  },
  {
    id: 5,
    name: "Dongas",
    image: "https://foodingbox.com/web/product/big/201706/18_shop1_970227.jpg",
    rating: 4.6
  }
];

function Food({ name, picture, rating }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <h4>{rating} / 5.0 </h4>
      <img src={picture} alt={name} />
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired
};

function App() {
  return (
    <div>
      {foodILike.map(dish => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
